 */
ALTER TABLE `order` CHANGE COLUMN `money` `t_amount` NUMERIC(16,4) NOT NULL DEFAULT 0 COMMENT '当前订单群总价格';
ALTER TABLE `order` CHANGE COLUMN `pay_money` `t_money` NUMERIC(16,4) NOT NULL DEFAULT 0 COMMENT '当前订单群总余额支付部分';
ALTER TABLE `order` CHANGE COLUMN `pay_profit` `t_profit` NUMERIC(16,4) NOT NULL DEFAULT 0 COMMENT '当前订单群总佣金支付部分';
ALTER TABLE `order` CHANGE COLUMN `pay_ticket` `t_ticket` NUMERIC(16,4) NOT NULL DEFAULT 0 COMMENT '当前订单群总优惠券支付部分';
ALTER TABLE `order` CHANGE COLUMN `pay_online` `t_online` NUMERIC(16,4) NOT NULL DEFAULT 0 COMMENT '当前订单群总在线支付部分';
ALTER TABLE `order` ADD COLUMN `t_chanel` TINYINT UNSIGNED NOT NULL DEFAULT 0 COMMENT '当前订单在线支付方式：1微信,2支付宝,3银联,4保留,5保留,6保留,7线下支付' AFTER `t_online`;

ALTER TABLE `order` ADD COLUMN `t_recruit` NUMERIC(16,4) NOT NULL DEFAULT 0 COMMENT '当前订单群总招聘支付部分' AFTER `t_profit`;
ALTER TABLE `order` ADD COLUMN `c_amount` NUMERIC(16,4) NOT NULL DEFAULT 0 COMMENT '当前订单价格' AFTER `t_chanel`;
ALTER TABLE `order` ADD COLUMN `c_money` NUMERIC(16,4) NOT NULL DEFAULT 0 COMMENT '当前订单余额支付部分' AFTER `t_chanel`;
ALTER TABLE `order` ADD COLUMN `c_profit` NUMERIC(16,4) NOT NULL DEFAULT 0 COMMENT '当前订单佣金支付部分' AFTER `t_chanel`;
ALTER TABLE `order` ADD COLUMN `c_recruit` NUMERIC(16,4) NOT NULL DEFAULT 0 COMMENT '当前订单招聘支付部分' AFTER `t_chanel`;
ALTER TABLE `order` ADD COLUMN `c_ticket` NUMERIC(16,4) NOT NULL DEFAULT 0 COMMENT '当前订单优惠券支付部分' AFTER `t_chanel`;
ALTER TABLE `order` ADD COLUMN `c_online` NUMERIC(16,4) NOT NULL DEFAULT 0 COMMENT '当前订单在线支付部分' AFTER `t_chanel`;


